import React, { Component } from 'react'

import { Card, CardImg, CardBody, FormFeedback, FormText,
    CardTitle, CardSubtitle, Form, FormGroup, Badge, Input, Media} from 'reactstrap';
export default class CardComment extends Component {

  render() {
    return (
        <Card > 
         <CardImg style={{margin:'auto', marginTop:'20px', width:'40px', height:'40px', borderRadius:'50%'}}  src="https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap" />


      </Card>
    )
  }
}
